INSERT INTO `qlu_announcement` VALUES (1, '这是一个公告', '这是一个公告的简介这是一个公告的简介这是一个公告的简介这是一个公告的简介这是一个公告的简介这是一个公告的简介', '这是一个公告', '0', 0, '0', '', '2022-01-06 21:26:54', '', '2022-04-17 10:58:06');
INSERT INTO `qlu_character` VALUES (1, '王灿--2017级--软件工程专业', '/profile/upload/2022/01/22/34dcc837-0dcb-4fea-b540-4595a3c9f5e1.png', '\n&ensp;&ensp;&ensp;&ensp;**王灿是学校ACM协会负责Online&nbsp;Judge在线判题系统搭建以及维护的第一任成员，从无到有为在初始阶段的学校ACM-ICPC协会搭建了日常训练以及测试用在线判题平台，为多个校际、校内ICPC赛事提供了技术支持。在搭建维护在线判题平台之余，他还向志同道合希望共同担起在线判题平台开发维护工作的同学做过多次开发、运维、网络相关技术的分享，涉及前后端Spring、Vue、Node.js等开发技术；Linux运维、Docker容器化技术等。**\n\n&ensp;&ensp;&ensp;&ensp;**在学校ICPC协会做开发、运维工作的这段经历，带给了他许多技术上的挑战，但这些挑战没有击垮他。他在面对技术难题时积极应对，查阅各个技术网站、文档，与平台开发者进行沟通，在这个过程中他接触到了专业课程外的计算机各方面的技术，对Web应用有更加全面的理解，在技术上进步了很多。**\n\n&ensp;&ensp;&ensp;&ensp;**在参与ICPC协会的技术支持工作之余，他还参加了省级、校级的多项比赛，获得省级奖项六项、校级奖项两项，国家级大学生创新创业项目一项，将掌握的技术落实为成果。他相信一切成果都源于日常积累、一切付出都会获得成果，相信自己可以拥有改变一切的实力！**', 'ojTeamMember', 0, '0', '', '2022-01-06 22:09:56', '', '2022-03-24 17:04:11');
INSERT INTO `qlu_character` VALUES (2, '周翔', '/profile/upload/2022/01/23/95e70697-2ca3-45f0-8e96-b1a7fcf7cb66.jpg', '&ensp;&ensp;&ensp;&ensp;**ACM集训队退役队员周翔，齐鲁工业大学2018级软件工程专业，网络信息中心橙果工作室前副主席。专业成绩排名前列，获学校二等奖学金2次，参与国家级、省级大学生创新创业训练计划各1项。曾在深圳依时货拉拉科技有限公司、济南超级计算技术研究院参加实习工作**。\n&ensp;&ensp;&ensp;&ensp;**获第十八届山东省大学生软件设计大赛一等奖、特等奖推荐；获第十届与第十一届蓝桥杯大赛省赛二等奖；获实用新型专利一项，计算机软件著作权两项。**\n&ensp;&ensp;&ensp;&ensp;**个人方向为web前端开发领域，擅长网站建设与维护、移动端APP开发、用户界面与用户体验设计。**\n&ensp;&ensp;&ensp;&ensp;**自集训队退役后仍心系比赛动向与学校集训队发展，为OJ小组提供友情协助，协助建设QLU&nbsp;Online&nbsp;Judge平台，主导开发工具类项目“ACM刷题助手”，为ACMer的刷题之旅添砖加瓦。**\n&ensp;&ensp;&ensp;&ensp;**凡是过往，皆为序章。衷心祝愿齐鲁工业大学ACM-ICPC集训队能够越办越好，在算法竞赛的赛场上摘金夺银，更创佳绩！**', 'teamMember', 1, '0', '', '2022-01-07 23:47:59', '', '2022-03-24 17:09:00');
INSERT INTO `qlu_character` VALUES (8, '梁延杰', '/profile/upload/2022/01/22/bbef235b-e649-45cb-99da-39a52bda2883.png', '<h1 align=\"center\">弘毅而宽厚，厚积而薄发</h1>\n<h2 align=\"right\">——优秀党员 梁延杰</h2>\n\n\n&ensp;&ensp;&ensp;&ensp;**梁延杰担任团支书、校 ACM-ICPC 协会会长、计算机学院第三党支部支委等职务，被评为山东省优秀学生干部。专业基础扎实，平均学分绩点 4.47，综合评价专业第一。包揽了国家奖学金、泉城奖学金等在内的全部奖学金，2020年以第一名的成绩被评为“校园十佳学生”、赢得校长奖学金。大学期间共获得 ICPC 国际大学生程序设计竞赛上海站铜牌、第十届蓝桥杯 国赛二等奖、第五届天梯赛全国银牌、个人银牌在内的国际级奖项一项，国家级奖项十七项，省级奖项七项，市级奖项一项，校级奖项十八项。作为一名党员，他有情怀。立志于人工智能领域，努力追求真知，他认为只有把人生理想融入国家和民族的事业中，才能最终成就一番事业。**\n&ensp;&ensp;&ensp;&ensp;**面对ACM-ICPC国际大学生程序设计竞赛这项难度空前的赛事，初期他屡战屡败。但是他并没有退缩，而是屡败屡战，迎难而上。作为机电楼A座6层训练机房“守夜人”，他和他的小伙伴们每天在机房解决各种编程题目，学习各种算法，一起打比赛、讨论问题，两年来在这里留下了几百个不眠之夜。**\n\n&ensp;&ensp;&ensp;&ensp;**一分耕耘，一分收获。经过了长时间的训练，他的编程水平有了质的飞跃，于是开始代表学校参加各种比赛。从ACM省赛，到ICPC亚洲区域赛，再到亚洲区域赛总决赛，多次比赛使他积累了丰富的经验，几次刷新学校最高纪录，也为学校获得了许多荣誉。**\n&ensp;&ensp;&ensp;&ensp;**他坚信，“现在，青春是用来奋斗的；将来，青春是用来回忆的。”三年的大学时光中，他以实际行动做到了“青春不息，奋斗不止”！**', 'teamMember', 0, '0', '', '2022-01-22 17:38:04', '', '2022-03-24 17:08:18');
INSERT INTO `qlu_character` VALUES (9, '鹿文鹏', '/profile/upload/2022/02/14/db75066c-ea1c-4a27-a484-aada68b747a4.jpg', '&ensp;&ensp;&ensp;&ensp;**鹿文鹏，教授，博士，硕士生导师。2002年6月获得山东师范大学教育技术学专业理学学士学位，2005年6月获得山东师范大学教育技术学理学硕士学位，2014年6月获得北京理工大学计算机应用技术专业工学博士学位。2016年10月至2017年10月赴悉尼科技大学高级分析研究所AAi开展访问研究。**\n&ensp;&ensp; &ensp;&ensp;**担任中国计算机学会自然语言处理专委会委员、中文信息学会青工委委员。主持国家自然科学青年基金项目1项、国家重点研发计划子课题1项、教育部产学合作协同育人项目1项、山东省教育厅科技计划项目1项，主持横向课题2项；作为主要成员参与国家重点基础研究发展计划1项、国家自然科学基金重点项目1项、其它基金项目5项；获得山东省高等学校优秀科研成果奖2项。**\n&ensp;&ensp;&ensp;&ensp;**长期从事人工智能领域的研究，在自然语言处理方面取得了一定的研究成果。发表CCF推荐列表或SCI/EI期刊论文20余篇，ESI高被引论文2篇；作为第一发明人获得发明专利授权十余项，已成果转化6项。主要研究方向：人工智能、自然语言处理、推荐系统等。**', 'teamTeacher', 0, '0', '', '2022-02-14 15:01:57', '', '2022-03-24 17:09:18');
INSERT INTO `qlu_character` VALUES (10, '王庆祥', '/profile/upload/2022/02/14/0945b37c-1ec4-430a-8bcf-6f117682e071.png', '&ensp;&ensp;&ensp;&ensp;**王庆祥, 副教授，工学博士，2014年取得山东大学计算机软件与理论专业博士学位。主持山东省自然科学基金面上项目1项、济南科技明星计划1项，参与国家自然科学基金4项、山东省自然科学基金面上项目2项。长期从事面部特征定位、抑郁症识别、表情传递、RGBD摄像头等方向的研究。**', 'teamTeacher', 0, '1', '', '2022-02-14 15:09:29', '', '2022-03-24 17:09:32');
INSERT INTO `qlu_character` VALUES (11, '赵龙', '/profile/upload/2022/02/14/a6c6a62b-23f0-4950-8be9-609325805d43.png', '&ensp;&ensp;&ensp;&ensp;**赵龙（1984-），工学博士，2016年博士毕业于武汉大学计算机学院，现为齐鲁工业大学计算机科学与技术学院讲师，硕士生导师。发表学术论文10余篇，均被SCI、EI收录。现主持国家自然科学基金项目一项，山东省自然科学基金项目一项，参与省级以上科研项目5项.主要研究方向：数据挖掘技术、深度学习等。**', 'teamTeacher', 0, '1', '', '2022-02-14 15:12:31', '', '2022-03-24 17:09:41');
