INSERT INTO `qlu_topic_collection` VALUES (1, 'QLU OJ基础算法题单V1.0', '# ACM-ICPC集训队\n\n欢迎你来到齐鲁工业大学\n\n期待你加入我们一起努力\n\n集训队2021级同学作为主力，完成了QLU OJ基础算法题单V1.0的制作，共86题。欢迎大家来一起刷题。每位贡献同学的名字，你可以在Hint信息中找到。具体题单请看这里：[https://yunpan.qlu.edu.cn:443/#/link/4F22A6343A3E1B1D46E732CFB773644E](https://yunpan.qlu.edu.cn:443/#/link/4F22A6343A3E1B1D46E732CFB773644E) 有效期限截止：2023-1-11\n\n比如，你想做题单中的2136快速排序这个题目，请单击上方的Problems菜单，而后在右侧搜索框中输入2136，即可找到这个题目。\n\nQLU OJ基础算法题单的前置题单为150题，具体请看这里：[https://icpc.qlu.edu.cn/site/news?id=50](https://icpc.qlu.edu.cn/site/news?id=50)。', '0', 0, '0', '', '2022-01-08 00:22:19', '', '2022-05-05 22:46:40');
INSERT INTO `qlu_topic_collection` VALUES (3, '常用网址导航', '[**QLUOJ**](http://icpc.qlu.edu.cn/)\n\n[**QLU OJ基础算法题单V1.0**](http://icpc.qlu.edu.cn/site/news?id=104)\n\n[**欢迎2021级新同学加入ACM-ICPC集训队! (含自学C语言指南和题目清单) (qlu.edu.cn)**](http://icpc.qlu.edu.cn/site/news?id=50)\n\n[**AcWing**](http://www.acwing.com/about/)\n\n[**AtCoder**](http://atcoder.jp/)\n\n[**Codeforces**](http://codeforces.com/)\n\n[**首页 - 洛谷 | 计算机科学教育新生态 (luogu.com.cn)**](http://www.luogu.com.cn/)\n\n[**牛客竞赛OJ_ACM/NOI/CSP/CCPC/ICPC_信息学编程算法训练平台 (nowcoder.com)**](http://ac.nowcoder.com/acm/home/589876986)\n\n[**2021年集训队日常训练出勤记录 (qq.com)**](http://docs.qq.com/sheet/DS2daRFVJTVdGWVZ3?addToGroup=1&amp;group_code=516991226&amp;tab=BB08J2)\n\n[**集训队寄语 (qq.com)**](http://https://docs.qq.com/doc/DT2ZtcHpYcUpWeGlY)\n', '3', 0, '0', '', '2022-01-10 22:44:02', '', '2022-03-24 12:27:53');
INSERT INTO `qlu_topic_collection` VALUES (4, '150题基础题目清单', '&ensp;&ensp;在题目清单中，同一个专题中的题目，大致按难度顺序排列。请根据清单中的题目ID号，在Problems页面中搜索题目做答。如需要答疑，可在我校ACM群内提问，会有队员答复；也可以向题目提供同学请教，在hint信息中有提供者个性签名；可咨询任意队员同学，不一定必须问题目提供者。有疑问的代码，请使用[https://paste.ubuntu.com/](https://paste.ubuntu.com/)在ACM群贴出讨论。\n请一定要按下方给出的顺序依次做题，由简单到复杂地学习，不要跳跃，否则，容易挫伤！\n\nPart1-顺序结构设计 1295，1296，1297，1298，1299，1300，1301，1302，1303，1304，1305，1306，1307，1309，1310\n\nPart2-选择结构设计 1403，1404，1414，1415，1418，1419，1424，1425，1411，1410，1409，1408，1407，1406，1405，1518\n\nPart3-while循环结构设计 1322，1327，1333，1363，1377，1401，1402，1431，1432\n\nPart4-for循环结构设计 1314，1316，1318，1324，1325，1328，1335，1339，1350，1353，1358，1361，1365，1440 1331，1338，1342，1346，1349，1352，1356，1357，1362，1366，1367，1370，1372，1374，1468\n\nPart5-函数应用 1484, 1485, 1486, 1360，1368，1378，1398，1400，1433，1434，1455，1456, 1488, 1489, 1501, 1502\n\nPart6-一维数组的应用 1330，1340，1341，1343，1345，1355，1359，1389，1395，1396，1397，1399，1313，1337，1347，1354，1369，1371，1379\n\nPart7-二维数组的应用 1381，1383，1311，1312，1317，1319，1320，1321，1323，1470\n\nPart8-字符数组的应用 1329，1332，1336，1373，1375，1376，1384，1388，1390，1391，1392，1393，1394， 1315，1326，1334，1344，1351，1364，1373，1380，1382，1385，1386，1387，1469\n\nPart9 ...... 请自行遍历Problems页面查找吧，应该能独立开展后续学习了\n\n2020级第一次入队选拔题目: [icpc.qlu.edu.cn/problem/index?tag=2020](https://icpc.qlu.edu.cn/problem/index?tag=2020)级第一次入队测试\n\n2020级第二次入队选拔题目: [icpc.qlu.edu.cn/problem/index?tag=2020](https://icpc.qlu.edu.cn/problem/index?tag=2020)级第二次入队测试\n\n2020级校赛: [icpc.qlu.edu.cn/problem/index?tag=2020](https://icpc.qlu.edu.cn/problem/index?tag=2020)级校赛\n\n2019级校赛: [icpc.qlu.edu.cn/problem/index?tag=2019](https://icpc.qlu.edu.cn/problem/index?tag=2019)级校赛\n\n该入门题单的后继题单为：基础算法题单，地址为：[https://icpc.qlu.edu.cn/site/news?id=104](https://icpc.qlu.edu.cn/site/news?id=104)', '0', 1, '0', '', '2022-01-19 22:23:21', '', '2022-05-05 23:04:46');
