INSERT INTO `qlu_topic_collection` VALUES (6, 'Domjudge 总体介绍', '<ul><li class=\"ql-align-justify\"><span class=\"ql-size-large\">DOMjudge是一个为编程竞赛服务的系统，包括ICPC区域赛以及世界总决赛。</span></li><li class=\"ql-align-justify\"><span class=\"ql-size-large\">竞赛类型为队伍在固定的时间内（通常为5小时）解决一定数目的题目（通常是8-11道）。题目通过编写某种允许的编程语言，读入相关数据并输出正确的结果来解决。</span></li><li class=\"ql-align-justify\"><span class=\"ql-size-large\">评测时应将对应的题解的源代码提交给评测系统，评测系统将自动编译并运行提交的程序，并将输出与标准答案对比。</span></li></ul>', '1', 0, '0', '', '2022-02-04 22:59:07', '', '2022-02-04 22:59:56');
