INSERT INTO `sys_oper_log` VALUES (317, '人物志管理', 2, 'com.qluoj.web.controller.addqluoj.QluCharacterController.edit()', 'PUT', 1, 'admin', NULL, '/addqluoj/character', '39.91.110.44', 'XX XX', '{\"postSort\":0,\"nameTitle\":\"周翔\",\"updateTime\":1642844002252,\"params\":{},\"imgUrl\":\"/profile/upload/2022/01/22/0a4eed6b-b911-429e-9c49-9170c30b69c1.jpg\",\"createBy\":\"\",\"createTime\":1641570479000,\"updateBy\":\"\",\"configId\":\"teamMember\",\"id\":\"2\",\"recordContent\":\"<p>这是周翔</p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-01-22 17:33:22');
INSERT INTO `sys_oper_log` VALUES (318, '人物志管理', 2, 'com.qluoj.web.controller.addqluoj.QluCharacterController.edit()', 'PUT', 1, 'admin', NULL, '/addqluoj/character', '39.91.110.44', 'XX XX', '{\"postSort\":1,\"nameTitle\":\"周翔\",\"updateTime\":1642844113536,\"params\":{},\"imgUrl\":\"/profile/upload/2022/01/22/0a4eed6b-b911-429e-9c49-9170c30b69c1.jpg\",\"createBy\":\"\",\"createTime\":1641570479000,\"updateBy\":\"\",\"configId\":\"teamMember\",\"id\":\"2\",\"recordContent\":\"<p>这是周翔</p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-01-22 17:35:13');
INSERT INTO `sys_oper_log` VALUES (319, '人物志管理', 1, 'com.qluoj.web.controller.addqluoj.QluCharacterController.add()', 'POST', 1, 'admin', NULL, '/addqluoj/character', '39.91.110.44', 'XX XX', '{\"postSort\":0,\"nameTitle\":\"梁延杰\",\"params\":{},\"imgUrl\":\"/profile/upload/2022/01/22/bbef235b-e649-45cb-99da-39a52bda2883.png\",\"createTime\":1642844283814,\"configId\":\"teamMember\",\"id\":\"8\",\"recordContent\":\"<p class=\\\"ql-align-center\\\"><strong class=\\\"ql-size-large\\\">弘毅而宽厚，厚积而薄发</strong></p><p class=\\\"ql-align-right\\\"><strong class=\\\"ql-size-large\\\">——优秀党员 梁延杰</strong></p><p>\\t<span class=\\\"ql-size-large\\\">梁延杰担任团支书、校 ACM-ICPC 协会会长、计算机学院第三党支部支委等职务，被评为山东省优秀学生干部。专业基础扎实，平均学分绩点 4.47，综合评价专业第一。包揽了国家奖学金、泉城奖学金等在内的全部奖学金，2020年以第一名的成绩被评为“校园十佳学生”、赢得校长奖学金。大学期间共获得 ICPC 国际大学生程序设计竞赛上海站铜牌、第十届蓝桥杯 国赛二等奖、第五届天梯赛全国银牌、个人银牌在内的国际级奖项一项，国家级奖项十七项，省级奖项七项，市级奖项一项，校级奖项十八项。</span></p><p class=\\\"ql-align-right\\\"><span class=\\\"ql-size-large\\\">\\t&nbsp;</span></p><p><span class=\\\"ql-size-large\\\">\\t作为一名党员，他有情怀。立志于人工智能领域，努力追求真知，他认为只有把人生理想融入国家和民族的事业中，才能最终成就一番事业。</span></p><p><span class=\\\"ql-size-large\\\">\\t面对ACM-ICPC国际大学生程序设计竞赛这项难度空前的赛事，初期他屡战屡败。但是他并没有退缩，而是屡败屡战，迎难而上。作为机电楼A座6层训练机房“守夜人”，他和他的小伙伴们每天在机房解决各种编程题目，学习各种算法，一起打比赛、讨论问题，两年来在这里留下了几百个不眠之夜。</span></p><p><span class=\\\"ql-size-large\\\">\\t一分耕耘，一分收获。经过了长时间的训练，他的编程水平有了质的飞跃，于是开始代表学校参加各种比赛。从ACM省赛，到ICPC亚洲区域赛，再到亚洲区域赛总决赛，多次比赛使他积累了丰富的经验，几次刷新学校最高纪录，也为学校获得了许多荣誉。</span></p><p><span class=\\\"ql-size-large\\\">&nbsp;&nbsp;他坚信，“现在，青春是用来奋斗的；将来，青春是用来回忆的。”三年的大学时光中，他以实际行动做到了“青春不息，奋斗不止”！</span></p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-01-22 17:38:03');
INSERT INTO `sys_oper_log` VALUES (320, '人物志管理', 2, 'com.qluoj.web.controller.addqluoj.QluCharacterController.edit()', 'PUT', 1, 'admin', NULL, '/addqluoj/character', '39.91.110.44', 'XX XX', '{\"postSort\":1,\"nameTitle\":\"周翔\",\"updateTime\":1642846614811,\"params\":{},\"imgUrl\":\"/profile/upload/2022/01/22/0a4eed6b-b911-429e-9c49-9170c30b69c1.jpg\",\"createBy\":\"\",\"createTime\":1641570479000,\"updateBy\":\"\",\"configId\":\"teamMember\",\"id\":\"2\",\"recordContent\":\"<p><span class=\\\"ql-size-large\\\">ACM集训队退役队员周翔，2018级软件工程专业，曾任网络信息中心橙果工作室副主席，专业排名前列，曾获学校二等奖学金与素质拓展奖。大学期间努力参加各种竞赛与项目组，参与国家级、省级大学生创新创业训练计划，以方向内第一，省排名第五的成绩获第十八届山东省大学生软件设计大赛一等奖与特等奖推荐，获第十届与第十一届蓝桥杯大赛省赛二等奖，获2021年“挑战杯”大学生课外学术科技作品竞赛校赛二等奖，获实用新型专利一项，有审批中的计算机软件著作权两项。获济南超级计算技术研究院并行计算技术研究中心实习offer，个人方向为web前端开发领域，擅长网站建设与维护、移动端APP开发、用户界面与用户体验设计。</span></p><p><br></p><p><span class=\\\"ql-size-large\\\">自集训队退役后仍心系比赛动向与学校集训队发展，为OJ小组提供友情协助，协助建设QLU&nbsp;Online&nbsp;Judge平台，主导开发工具类项目“ACM刷题助手”，为ACMer的刷题之旅添砖加瓦。</span></p><p><br></p><p><span class=\\\"ql-size-large\\\">凡是过往，皆为序章。衷心祝愿齐鲁工业大学ACM-ICPC集训队能够越办越好，在算法竞赛的赛场上摘金夺银，更创佳绩！</span></p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-01-22 18:16:54');
INSERT INTO `sys_oper_log` VALUES (321, '人物志管理', 2, 'com.qluoj.web.controller.addqluoj.QluCharacterController.edit()', 'PUT', 1, 'admin', NULL, '/addqluoj/character', '39.91.110.44', 'XX XX', '{\"postSort\":1,\"nameTitle\":\"周翔\",\"updateTime\":1642863398315,\"params\":{},\"imgUrl\":\"/profile/upload/2022/01/22/0a4eed6b-b911-429e-9c49-9170c30b69c1.jpg\",\"createBy\":\"\",\"createTime\":1641570479000,\"updateBy\":\"\",\"configId\":\"teamMember\",\"id\":\"2\",\"recordContent\":\"<p><span class=\\\"ql-size-large\\\">ACM集训队退役队员周翔，齐鲁工业大学2018级软件工程专业，网络信息中心橙果工作室前副主席。专业成绩排名前列，获学校二等奖学金2次，参与国家级、省级大学生创新创业训练计划各1项。曾在深圳依时货拉拉科技有限公司、济南超级计算技术研究院参加实习工作。</span></p><p><span class=\\\"ql-size-large\\\">获第十八届山东省大学生软件设计大赛一等奖、特等奖推荐；获第十届与第十一届蓝桥杯大赛省赛二等奖；获实用新型专利一项，计算机软件著作权两项。</span></p><p><span class=\\\"ql-size-large\\\">个人方向为web前端开发领域，擅长网站建设与维护、移动端APP开发、用户界面与用户体验设计。</span></p><p><br></p><p><span class=\\\"ql-size-large\\\">自集训队退役后仍心系比赛动向与学校集训队发展，为OJ小组提供友情协助，协助建设QLU&nbsp;Online&nbsp;Judge平台，主导开发工具类项目“ACM刷题助手”，为ACMer的刷题之旅添砖加瓦。</span></p><p><br></p><p><span class=\\\"ql-size-large\\\">凡是过往，皆为序章。衷心祝愿齐鲁工业大学ACM-ICPC集训队能够越办越好，在算法竞赛的赛场上摘金夺银，更创佳绩！</span></p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-01-22 22:56:38');
