INSERT INTO `sys_oper_log` VALUES (330, '人物志管理', 2, 'com.qluoj.web.controller.addqluoj.QluCharacterController.edit()', 'PUT', 1, 'QLUOJ', NULL, '/addqluoj/character', '39.91.110.44', 'XX XX', '{\"postSort\":1,\"nameTitle\":\"周翔\",\"updateTime\":1642868103233,\"params\":{},\"imgUrl\":\"/profile/upload/2022/01/23/95e70697-2ca3-45f0-8e96-b1a7fcf7cb66.jpg\",\"createBy\":\"\",\"createTime\":1641570479000,\"updateBy\":\"\",\"configId\":\"teamMember\",\"id\":\"2\",\"recordContent\":\"<p><span class=\\\"ql-size-large\\\">ACM集训队退役队员周翔，齐鲁工业大学2018级软件工程专业，网络信息中心橙果工作室前副主席。专业成绩排名前列，获学校二等奖学金2次，参与国家级、省级大学生创新创业训练计划各1项。曾在深圳依时货拉拉科技有限公司、济南超级计算技术研究院参加实习工作。</span></p><p><span class=\\\"ql-size-large\\\">获第十八届山东省大学生软件设计大赛一等奖、特等奖推荐；获第十届与第十一届蓝桥杯大赛省赛二等奖；获实用新型专利一项，计算机软件著作权两项。</span></p><p><span class=\\\"ql-size-large\\\">个人方向为web前端开发领域，擅长网站建设与维护、移动端APP开发、用户界面与用户体验设计。</span></p><p><br></p><p><span class=\\\"ql-size-large\\\">自集训队退役后仍心系比赛动向与学校集训队发展，为OJ小组提供友情协助，协助建设QLU&nbsp;Online&nbsp;Judge平台，主导开发工具类项目“ACM刷题助手”，为ACMer的刷题之旅添砖加瓦。</span></p><p><br></p><p><span class=\\\"ql-size-large\\\">凡是过往，皆为序章。衷心祝愿齐鲁工业大学ACM-ICPC集训队能够越办越好，在算法竞赛的赛场上摘金夺银，更创佳绩！</span></p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-01-23 00:15:03');
