INSERT INTO `sys_oper_log` VALUES (448, '公告通知管理', 1, 'com.qluoj.web.controller.addqluoj.QluAnnouncementController.add()', 'POST', 1, 'QLUOJ', NULL, '/addqluoj/announcement', '112.36.5.61', 'XX XX', '{\"postSort\":0,\"params\":{},\"title\":\"集训队第一批捐赠情况\",\"createTime\":1643986027678,\"configId\":\"1\",\"id\":\"3\",\"recordContent\":\"<p><img src=\\\"/prod-api/profile/upload/2022/02/04/49e12eb4-bae5-44ce-8092-c22a7c68c404.png\\\"></p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-02-04 22:47:07');
INSERT INTO `sys_oper_log` VALUES (449, '题集资源管理', 1, 'com.qluoj.web.controller.addqluoj.QluTopicCollectionController.add()', 'POST', 1, 'QLUOJ', NULL, '/addqluoj/collection', '112.36.5.61', 'XX XX', '{\"postSort\":0,\"params\":{},\"createTime\":1643986747001,\"configId\":\"1\",\"name\":\"Domjudge 总体介绍\",\"id\":\"6\",\"recordContent\":\"<p>DOMjudge是一个为编程竞赛服务的系统，包括ICPC区域赛以及世界总决赛。</p><p>竞赛类型为队伍在固定的时间内（通常为5小时）解决一定数目的题目（通常是8-11道）。题目通过编写某种允许的编程语言，读入相关数据并输出正确的结果来解决。</p><p>评测时应将对应的题解的源代码提交给评测系统，评测系统将自动编译并运行提交的程序，并将输出与标准答案对比。</p><p><br></p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-02-04 22:59:07');
