INSERT INTO `sys_oper_log` VALUES (453, '人物志管理', 1, 'com.qluoj.web.controller.addqluoj.QluCharacterController.add()', 'POST', 1, 'QLUOJ', NULL, '/addqluoj/character', '111.14.8.46', 'XX XX', '{\"postSort\":0,\"nameTitle\":\"鹿文鹏\",\"params\":{},\"imgUrl\":\"/profile/upload/2022/02/14/db75066c-ea1c-4a27-a484-aada68b747a4.jpg\",\"createTime\":1644822116746,\"configId\":\"teamTeacher\",\"id\":\"9\",\"recordContent\":\"<p>\\t\\t<strong>鹿文鹏，教授，博士，硕士生导师。2002年6月获得山东师范大学教育技术学专业理学学士学位，2005年6月获得山东师范大学教育技术学理学硕士学位，2014年6月获得北京理工大学计算机应用技术专业工学博士学位。2016年10月至2017年10月赴悉尼科技大学高级分析研究所AAi开展访问研究。</strong></p><p><strong>       担任中国计算机学会自然语言处理专委会委员、中文信息学会青工委委员。主持国家自然科学青年基金项目1项、国家重点研发计划子课题1项、教育部产学合作协同育人项目1项、山东省教育厅科技计划项目1项，主持横向课题2项；作为主要成员参与国家重点基础研究发展计划1项、国家自然科学基金重点项目1项、其它基金项目5项；获得山东省高等学校优秀科研成果奖2项。</strong></p><p><strong>       长期从事人工智能领域的研究，在自然语言处理方面取得了一定的研究成果。发表CCF推荐列表或SCI/EI期刊论文20余篇，ESI高被引论文2篇；作为第一发明人获得发明专利授权十余项，已成果转化6项。主要研究方向：人工智能、自然语言处理、推荐系统等。</strong></p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-02-14 15:01:56');
