INSERT INTO `sys_oper_log` VALUES (455, '人物志管理', 1, 'com.qluoj.web.controller.addqluoj.QluCharacterController.add()', 'POST', 1, 'QLUOJ', NULL, '/addqluoj/character', '111.14.8.46', 'XX XX', '{\"postSort\":0,\"nameTitle\":\"王庆祥\",\"params\":{},\"imgUrl\":\"/profile/upload/2022/02/14/0945b37c-1ec4-430a-8bcf-6f117682e071.png\",\"createTime\":1644822568853,\"configId\":\"teamTeacher\",\"id\":\"10\",\"recordContent\":\"<p>\\t\\t<strong>王庆祥, 副教授，工学博士，2014年取得山东大学计算机软件与理论专业博士学位。主持山东省自然科学基金面上项目1项、济南科技明星计划1项，参与国家自然科学基金4项、山东省自然科学基金面上项目2项。长期从事面部特征定位、抑郁症识别、表情传递、RGBD摄像头等方向的研究。</strong></p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-02-14 15:09:28');
INSERT INTO `sys_oper_log` VALUES (456, '人物志管理', 1, 'com.qluoj.web.controller.addqluoj.QluCharacterController.add()', 'POST', 1, 'QLUOJ', NULL, '/addqluoj/character', '111.14.8.46', 'XX XX', '{\"postSort\":0,\"nameTitle\":\"赵龙\",\"params\":{},\"imgUrl\":\"/profile/upload/2022/02/14/a6c6a62b-23f0-4950-8be9-609325805d43.png\",\"createTime\":1644822751234,\"configId\":\"teamTeacher\",\"id\":\"11\",\"recordContent\":\"<p>\\t\\t<strong class=\\\"ql-size-large\\\">赵龙（1984-），工学博士，2016年博士毕业于武汉大学计算机学院，现为齐鲁工业大学计算机科学与技术学院讲师，硕士生导师。发表学术论文10余篇，均被SCI、EI收录。现主持国家自然科学基金项目一项，山东省自然科学基金项目一项，参与省级以上科研项目5项.主要研究方向：数据挖掘技术、深度学习等。</strong></p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-02-14 15:12:31');
