INSERT INTO `sys_oper_log` VALUES (472, '人物志管理', 2, 'com.qluoj.web.controller.addqluoj.QluCharacterController.edit()', 'PUT', 1, 'admin', NULL, '/addqluoj/character', '127.0.0.1', '内网IP', '{\"postSort\":0,\"nameTitle\":\"王灿--2017级--软件工程专业\",\"updateTime\":1647939431098,\"params\":{},\"imgUrl\":\"/profile/upload/2022/01/22/34dcc837-0dcb-4fea-b540-4595a3c9f5e1.png\",\"createBy\":\"\",\"createTime\":1641478196000,\"updateBy\":\"\",\"configId\":\"ojTeamMember\",\"id\":\"1\",\"recordContent\":\"<p><span class=\\\"ql-size-large\\\">王灿是学校ACM协会负责Online&nbsp;Judge在线判题系统搭建以及维护的第一任成员，从无到有为在初始阶段的学校ACM-ICPC协会搭建了日常训练以及测试用在线判题平台，为多个校际、校内ICPC赛事提供了技术支持。在搭建维护在线判题平台之余，他还向志同道合希望共同担起在线判题平台开发维护工作的同学做过多次开发、运维、网络相关技术的分享，涉及前后端Spring、Vue、Node.js等开发技术；Linux运维、Docker容器化技术等。</span></p><p><br></p><p><span class=\\\"ql-size-large\\\">在学校ICPC协会做开发、运维工作的这段经历，带给了他许多技术上的挑战，但这些挑战没有击垮他。他在面对技术难题时积极应对，查阅各个技术网站、文档，与平台开发者进行沟通，在这个过程中他接触到了专业课程外的计算机各方面的技术，对Web应用有更加全面的理解，在技术上进步了很多。</span></p><p><br></p><p><span class=\\\"ql-size-large\\\">在参与ICPC协会的技术支持工作之余，他还参加了省级、校级的多项比赛，获得省级奖项六项、校级奖项两项，国家级大学生创新创业项目一项，将掌握的技术落实为成果。他相信一切成果都源于日常积累、一切付出都会获得成果，相信自己可以拥有改变一切的实力！</span></p>\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-03-22 16:57:11');
INSERT INTO `sys_oper_log` VALUES (473, '人物志管理', 2, 'com.qluoj.web.controller.addqluoj.QluCharacterController.edit()', 'PUT', 1, 'admin', NULL, '/addqluoj/character', '127.0.0.1', '内网IP', '{\"postSort\":0,\"nameTitle\":\"赵龙\",\"updateTime\":1647939530856,\"params\":{},\"imgUrl\":\"/profile/upload/2022/02/14/a6c6a62b-23f0-4950-8be9-609325805d43.png\",\"createBy\":\"\",\"createTime\":1644822751000,\"updateBy\":\"\",\"configId\":\"teamTeacher\",\"id\":\"11\",\"recordContent\":\"<p>\\t\\t<strong class=\\\"ql-size-large\\\">赵龙（1984-），工学博士，2016年博士毕业于武汉大学计算机学院，现为齐鲁工业大学计算机科学与技术学院讲师，硕士生导师。发表学术论文10余篇，均被SCI、EI收录。现主持国家自然科学基金项目一项，山东省自然科学基金项目一项，参与省级以上科研项目5项.主要研究方向：数据挖掘技术、深度学习等。</strong></p>测试修改\",\"status\":\"1\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-03-22 16:58:50');
