INSERT INTO `sys_oper_log` VALUES (476, '公告通知管理', 2, 'com.qluoj.web.controller.addqluoj.QluAnnouncementController.edit()', 'PUT', 1, 'admin', NULL, '/addqluoj/announcement', '124.133.41.227', 'XX XX', '{\"postSort\":0,\"updateTime\":1648013998088,\"params\":{},\"title\":\"集训队第一批捐赠情况\",\"createBy\":\"\",\"createTime\":1643986028000,\"updateBy\":\"\",\"configId\":\"1\",\"id\":\"3\",\"recordContent\":\"![Description](/prod-api/profile/upload/2022/02/04/49e12eb4-bae5-44ce-8092-c22a7c68c404.png)\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-03-23 13:39:58');
INSERT INTO `sys_oper_log` VALUES (477, '人物志管理', 2, 'com.qluoj.web.controller.addqluoj.QluCharacterController.edit()', 'PUT', 1, 'admin', NULL, '/addqluoj/character', '124.133.41.227', 'XX XX', '{\"postSort\":0,\"nameTitle\":\"王灿--2017级--软件工程专业\",\"updateTime\":1648094165750,\"params\":{},\"imgUrl\":\"/profile/upload/2022/01/22/34dcc837-0dcb-4fea-b540-4595a3c9f5e1.png\",\"createBy\":\"\",\"createTime\":1641478196000,\"updateBy\":\"\",\"configId\":\"ojTeamMember\",\"id\":\"1\",\"recordContent\":\"**王灿是学校ACM协会负责Online&nbsp;Judge在线判题系统搭建以及维护的第一任成员，从无到有为在初始阶段的学校ACM-ICPC协会搭建了日常训练以及测试用在线判题平台，为多个校际、校内ICPC赛事提供了技术支持。在搭建维护在线判题平台之余，他还向志同道合希望共同担起在线判题平台开发维护工作的同学做过多次开发、运维、网络相关技术的分享，涉及前后端Spring、Vue、Node.js等开发技术；Linux运维、Docker容器化技术等。**\\n\\n**在学校ICPC协会做开发、运维工作的这段经历，带给了他许多技术上的挑战，但这些挑战没有击垮他。他在面对技术难题时积极应对，查阅各个技术网站、文档，与平台开发者进行沟通，在这个过程中他接触到了专业课程外的计算机各方面的技术，对Web应用有更加全面的理解，在技术上进步了很多。**\\n\\n**在参与ICPC协会的技术支持工作之余，他还参加了省级、校级的多项比赛，获得省级奖项六项、校级奖项两项，国家级大学生创新创业项目一项，将掌握的技术落实为成果。他相信一切成果都源于日常积累、一切付出都会获得成果，相信自己可以拥有改变一切的实力！**\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-03-24 11:56:05');
