INSERT INTO `sys_oper_log` VALUES (546, '题集资源管理', 2, 'com.train.web.controller.addqluoj.QluTopicCollectionController.edit()', 'PUT', 1, 'admin', NULL, '/addqluoj/collection', '127.0.0.1', '内网IP', '{\"postSort\":0,\"updateTime\":1651761935558,\"params\":{},\"createBy\":\"\",\"createTime\":1641572539000,\"updateBy\":\"\",\"configId\":\"0\",\"name\":\"QLU OJ基础算法题单V1.0\",\"id\":\"1\",\"recordContent\":\"# ACM-ICPC集训队\\n\\n欢迎你来到齐鲁工业大学\\n\\n期待你加入我们一起努力\\n\\n        集训队2021级同学作为主力，完成了QLU OJ基础算法题单V1.0的制作，共86题。欢迎大家来一起刷题。每位贡献同学的名字，你可以在Hint信息中找到。具体题单请看这里：https://yunpan.qlu.edu.cn:443/#/link/4F22A6343A3E1B1D46E732CFB773644E 有效期限截止：2023-1-11\\n\\n        比如，你想做题单中的2136快速排序这个题目，请单击上方的Problems菜单，而后在右侧搜索框中输入2136，即可找到这个题目。\\n\\n        QLU OJ基础算法题单的前置题单为150题，具体请看这里：https://icpc.qlu.edu.cn/site/news?id=50。\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-05-05 22:45:35');
